import React from "react";
import "../stylesheets/ClubList.scss";
import Club from "./Club";

const ClubList = () => {
  return (
    <>
      <ul className="list">
        <Club
          icon={props.clubs.fa}
          name={props.clubs.name}
          members={props.clubs.members}
        />
      </ul>
    </>
  );
};

export default ClubList;
